import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";
import "./Main.css";
import Login from "./Login.js";
import Intro from "./Intro.js";

// import required modules
import { Pagination } from "swiper";

const Main = () => {
    return (
    <div class = "Main">
    <Swiper
      direction={"vertical"}
      pagination={{
        clickable: true
      }}
      modules={[Pagination]}
      className="mySwiper"
    >
      <SwiperSlide>
        <div class = "start">
          <div class = "start1">
            <span> Animal Behavior </span>
            <span> Briefly Analyze in B-fact </span>
          </div>
          <div class = "start2">
            button
          </div>
        </div>
      </SwiperSlide>
      <SwiperSlide><Login /></SwiperSlide>
      <SwiperSlide>Upload</SwiperSlide>
      <SwiperSlide>Option</SwiperSlide>
    </Swiper>
    </div>
  );
}

export default Main;
